import React from 'react'
import styled from 'styled-components'


interface Props {
  className?: string 
}

let  Advisery: React.FC<Props> = ( {className }) => {
  return (
    <div className={className}>
      advisery
    </div>
  )
}


Advisery = styled(Advisery)`
  grid-area: advisery;
  border-radius: 10px;
  background: var(--grey-light);

`

export default  Advisery
